import React from "react";
import "react-native-gesture-handler";
import { Image, SafeAreaView, StyleSheet } from "react-native";
import RequestsList from "../Requests/RequestsList";
import { Block, Text } from "../../assets";
import { View, Button } from "native-base";
import authStore from "../../stores/authStore";

import RequestModal from "../Requests/RequestModal";

// Components

const Timeline = ({ navigation }) => {
  const logout = () => {
    authStore.logOut(navigation);
  };
  return (
    <View>
      <Block flex={0.42} column style={{ paddingHorizontal: 15 }}>
        <Block flex={false} row style={{ paddingVertical: 15 }}>
          <Block center>
            <Text h3 white style={{ marginRight: -(25 + 5) }}>
              Blood Requests
            </Text>
          </Block>
          {/* <Image style={styles.avatar} source={user.avatar} /> */}
        </Block>
        <Block card shadow color="white">
          <Block row space="between" style={{ paddingHorizontal: 30 }}>
            <Block flex={false} row center>
              <Text h1>291</Text>
              <Text caption bold tertiary style={{ paddingHorizontal: 10 }}>
                -12%
              </Text>
            </Block>
            <Block flex={false} row center>
              <Text caption bold primary style={{ paddingHorizontal: 10 }}>
                +49%
              </Text>
              <Text h1>481</Text>
            </Block>
          </Block>
          <Block
            flex={0.5}
            row
            space="between"
            style={{ paddingHorizontal: 30 }}
          >
            <Text caption light>
              Available
            </Text>
            <Text caption light>
              Requests
            </Text>
          </Block>
        </Block>
      </Block>
      <SafeAreaView style={(styles.body, { backgroundColor: "##ffffff" })}>
        <RequestsList navigation={navigation} />
        <RequestModal />
      </SafeAreaView>
      <Button onPress={logout}>logout</Button>
    </View>
  );
};

export default Timeline;

const styles = StyleSheet.create({
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center",
  },
  container: {
    marginTop: 80,
    alignContent: "center",
    justifyContent: "center",
    alignSelf: "center",
    textAlign: "center",
  },
  button: {
    marginHorizontal: 20,
    marginTop: 500,
    textAlign: "center",
    margin: 5,
    color: "#171717",
    borderRadius: 10,
    height: 60,
    width: 350,
    padding: 15,
    backgroundColor: "#171717",
  },
  logo: {
    alignSelf: "center",
    height: 150,
    width: 130,
    marginTop: -40,
  },
  body: {
    flex: 1,
  },
});
